  \"2015-06-19T15:28:23.440725\",\n\t\"name\": \"wvsamb-color-digital-orthophotos-north-zone87572\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Digital color orthophotography of the State
  of West Virginia (West Virginia State Plane Coordinate System North Zone). The W.V.
  state plane system has two cartographic zones, north and south. This data set consists
  of 10,000' x 10,000' uncompressed 24-bit natural color TIFF files at a pixel resolution
  of 2.0' and 10,000' x 10000' compressed 24 bit-bit natural color MrSid files at
  a pixel resolution of 2.0'. Digital orthophotography combines the image characteristics
  of a photograph with the geometric qualities of a map. Digital orthophotography
  is a process which converts aerial photography from an original photo negative to
  a digital product that has been positionally corrected for camera lens distortion,
  vertical displacement and variations in aircraft altitude and orientation. The imagery
  was captured at a negative scale of 1\" = 2400' in the spring of 2003 for the purpose
  of producing natural color digital orthophotos at a 2' pixel resolution. The ortho-rectification
  process has achieved less than 9.8' ft. horizontal accuracy at a 95% confidence
  level.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
